import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Search from './Search';

function App() {
  return (
    <Router>
        <Switch>
          <Route path="/" element={Search} />
        </Switch>
    </Router>
  );
}

export default App;
